if (msg.payload === "") {
    return null;
}


let lines = msg.payload.split('\n');


let msg1 = null;
let msg2 = null;
let msg3 = null;
let msg4 = null;
let msg5 = null;


let regex = /([0-9]+\.[0-9]+)/;

lines.forEach(line => {
    let match = line.match(regex);
    if (match) {
        let value = parseFloat(match[1]);
        if (line.includes('Sensor 1')) {
            msg1 = { payload: value };
        } else if (line.includes('Sensor 2')) {
            msg2 = { payload: value };
        } else if (line.includes('Sensor 3')) {
            msg3 = { payload: value };
        } else if (line.includes('Sensor 4')) {
            msg4 = { payload: value };
        } else if (line.includes('Sensor 5')) {
            msg5 = { payload: value };        
        }
    }
});

return [msg1, msg2, msg3, msg4, msg5];
